import { NavLink } from 'react-router-dom';

function Header() {
  const navLinks = [
    ['Главная', '/'],
    ['Бани', '/bany'],
    ['Кухня', '/citchen'],
    ['Массаж', '/massages'],
    ['Контакты', '/contact']
  ];

  return (
    <header className='flex '>
        <div className='flex '>
            <img src="/img/Logo.png" alt="" />
        </div>
      <nav>
        {navLinks.map(([title, url]) => (
          <NavLink
            key={title}           
            to={url}             
            className={({ isActive }) => 
              isActive ? 'active-link' : ''  
            }
          >
            {title}
          </NavLink>
        ))}
      </nav>
    </header>
  );
}

export default Header;
